import '../styles/Resume.css';

function Resume() {
	return (
		<section id="resume" style={{ padding: '2rem', backgroundColor: '#f0f0f0' }}>
			<h2>Resume</h2>
				<p>Ceci est la section Resume.</p>
		</section>
	)
}


export default Resume;
